bugfixes = 0			; if 1, include bug fixes
enable_run = 0			; if 1, you can run while holding the B button
revision = 1			; 0 = Japanese; 1 = English; 2 = Portuguese


	cpu 68000
	include "ps3.macrosetup.asm"

	include "ps3.constants.asm"


StartOfRom:
	if (*) <> 0
	fatal	"Start of ROM is at address $\{*}, but it should be at address 0."
	endif

VectorTable:
	dc.l	system_stack, EntryPoint, ErrorTrap, ErrorTrap
	dc.l	ErrorTrap, ErrorTrap, ErrorTrap, ErrorTrap
	dc.l	ErrorTrap, ErrorTrap, ErrorTrap, ErrorTrap
	dc.l	ErrorTrap, ErrorTrap, ErrorTrap, ErrorTrap
	dc.l	ErrorTrap, ErrorTrap, ErrorTrap, ErrorTrap
	dc.l	ErrorTrap, ErrorTrap, ErrorTrap, ErrorTrap
	dc.l	ErrorTrap, ErrorTrap, ErrorTrap, ErrorTrap
	dc.l	HBlank, ErrorTrap, VBlank, ErrorTrap
	dc.l	ErrorTrap, ErrorTrap, ErrorTrap, ErrorTrap
	dc.l	ErrorTrap, ErrorTrap, ErrorTrap, ErrorTrap
	dc.l	ErrorTrap, ErrorTrap, ErrorTrap, ErrorTrap
	dc.l	ErrorTrap, ErrorTrap, ErrorTrap, ErrorTrap
	dc.l	ErrorTrap, ErrorTrap, ErrorTrap, ErrorTrap
	dc.l	ErrorTrap, ErrorTrap, ErrorTrap, ErrorTrap
	dc.l	ErrorTrap, ErrorTrap, ErrorTrap, ErrorTrap
	dc.l	ErrorTrap, ErrorTrap, ErrorTrap, ErrorTrap

Header:
	if revision=0
	dc.b	"SEGA MEGA DRIVE " ; Console name
	dc.b 	"(C)SEGA 1990.APL" ; Copyright/Date
	dc.b 	"TOKINO          KEISHOUSHA      PHANTASY STAR 3 " ; Domestic name
	dc.b 	"PHANTASY STAR 3                                 " ; International name
	dc.b 	"GM 5503-00    "   ; Version

Checksum:
	dc.w	$19D2		; Checksum
	dc.b 	"J               " ; I/O Support
	dc.l 	StartOfRom		; ROM Start

ROMEndLoc:
	dc.l	EndOfRom-1		; ROM End
	dc.l 	ram_start&$FFFFFF		; RAM Start
	dc.l 	ram_end&$FFFFFF		; RAM End
	dc.l 	$5241F820		; Backup RAM ID
	dc.l 	$200001		; Backup RAM start address
	dc.l 	$203FFF		; Backup RAM end address
	dc.b 	"            "	; Modem support
	dc.b 	"                                        "	; Notes
	dc.b 	"J               " ; Country
	
	elseif revision=2

	dc.b	"SEGA MEGA DRIVE " ; Console name
	dc.b 	"(C)SEGA 1997.JUL" ; Copyright/Date
	dc.b 	"TOKINO          KEISHOUSHA      PHANTASY STAR 3 " ; Domestic name
	dc.b 	"PHANTASY STAR 3 GENERATIONS     OF DOOM         " ; International name
	dc.b 	"GM MK-1303 -00"   ; Version

Checksum:
	dc.w	$983B		; Checksum
	dc.b 	"J               " ; I/O Support
	dc.l 	StartOfRom		; ROM Start

ROMEndLoc:
	dc.l	EndOfRom-1		; ROM End
	dc.l 	ram_start&$FFFFFF		; RAM Start
	dc.l 	ram_end&$FFFFFF		; RAM End
	dc.l 	$5241F820		; Backup RAM ID
	dc.l 	$200001		; Backup RAM start address
	dc.l 	$203FFF		; Backup RAM end address
	dc.b 	"            "	; Modem support
	dc.b 	"                                        "	; Notes
	dc.b 	"F               " ; Country

	else
	
	dc.b	"SEGA MEGA DRIVE " ; Console name
	dc.b 	"(C)SEGA 1991.APL" ; Copyright/Date
	dc.b 	"TOKINO          KEISHOUSHA      PHANTASY STAR 3 " ; Domestic name
	dc.b 	"PHANTASY STAR 3 GENERATIONS     OF DOOM         " ; International name
	dc.b 	"GM 1303-01    "   ; Version

Checksum:
	dc.w	$3A33		; Checksum
	dc.b 	"J               " ; I/O Support
	dc.l 	StartOfRom		; ROM Start

ROMEndLoc:
	dc.l	EndOfRom-1		; ROM End
	dc.l 	ram_start&$FFFFFF		; RAM Start
	dc.l 	ram_end&$FFFFFF		; RAM End
	dc.l 	$5241F820		; Backup RAM ID
	dc.l 	$200001		; Backup RAM start address
	dc.l 	$203FFF		; Backup RAM end address
	dc.b 	"            "	; Modem support
	dc.b 	"                                        "	; Notes
	dc.b 	"UE              " ; Country
	
	endif
	
EndOfHeader:
	if (*) <> $200
	fatal	"End of header is at address $\{*}, but it should be at address $200. The header + the vector table must be exactly 512 bytes long"
	endif


ErrorTrap:
	if revision<>2
	nop
	nop
	nop
	nop
	endif

EntryPoint:
	if revision<>2
	nop
	nop
	nop
	nop
	nop
	nop
	nop
	nop
	nop
	nop
	nop
	nop
	endif

	tst.l	hw_port_1_control-1
loc_226:
	if revision=2
	bne.s	+
	tst.w	hw_expansion_control-1
+
	bne.s	loc_2B8
	else
	bne.w	loc_2B8
	tst.w	hw_expansion_control-1
	bne.s	loc_226
	endif

	lea	SetupValues(pc), a5
	if revision=2
	movem.w	(a5)+, d5-d7
	movem.l	(a5)+, a0-a4
	else
	movem.l	(a5)+, d5-a4
	endif
	move.b	hw_version-z80_bus_request(a1), d0	; get hardware version
	andi.b	#$F, d0
	beq.s	SkipSecurity			; branch if we're using the first hardware model
	move.l	#'SEGA', security_addr-z80_bus_request(a1)	; satisfy the TMSS so that VDP access is enabled
SkipSecurity:
	move.w	(a4), d0	; Read the VDP to see if it works (if we don't put the bytes "SEGA" into the TMSS, access to the VDP will cause the 68000 to lock up)
	moveq	#0, d0
	movea.l	d0, a6
	if revision=2
	move.l	a6, usp
	endif
	moveq	#(VDPInitValuesEnd-VDPInitValues)-1, d1
VDPInitLoop:
	move.b	(a5)+, d5
	move.w	d5, (a4)
	add.w	d7, d5
	dbf	d1, VDPInitLoop

	if revision=2
	move.l	(a5)+, (a4)
	else
	move.l	#$40000080, (a4)
	endif
	move.w	d0, (a3)
	move.w	d7, (a1)
	move.w	d7, (a2)
-
	btst	d0, (a1)
	bne.s	-			; wait for Z80
	moveq	#(Z80StartupCode_End-Z80StartupCode)-1, d2
Z80InitLoop:
	move.b	(a5)+, (a0)+
	dbf	d2, Z80InitLoop

	move.w	d0, (a2)
	move.w	d0, (a1)	; start the Z80
	move.w	d7, (a2)	; reset the Z80
ClrRAMLoop:
	move.l	d0, -(a6)
	dbf	d6, ClrRAMLoop

	if revision=2
	move.l	(a5)+, (a4)
	move.l	(a5)+, (a4)
	else
	move.l	#$81048F02, (a4)
	move.l	#$C0000000, (a4)
	endif
	moveq	#$1F, d3
ClrCRAMLoop:
	move.l	d0, (a3)
	dbf	d3, ClrCRAMLoop

	if revision=2
	move.l	(a5)+, (a4)
	else
	move.l	#$40000010, (a4)
	endif
	moveq	#$13, d4
ClrVSRAMLoop:
	move.l	d0, (a3)
	dbf	d4, ClrVSRAMLoop

	moveq	#(PSGInitValues_End-PSGInitValues)-1, d5
PSGInitLoop:
	move.b	(a5)+, $11(a3)	; reset the PSG
	dbf	d5, PSGInitLoop

	move.w	d0, (a2)
	movem.l	(a6), d0-a6	; clear all registers
	move	#$2700, sr
loc_2B8:
	if revision=2
	bra.s	ChecksumOK
; ====================================
SetupValues:
	dc.w	$8000				;D5
	dc.w	$3FFF				;D6
	dc.w	$100				;D7
	dc.l	z80_ram				;A0
	dc.l	z80_bus_request		;A1
	dc.l	z80_reset			;A2
	dc.l	vdp_data_port		;A3
	dc.l	vdp_control_port	;A4

VDPInitValues:
	dc.b	$04		; Command $8004 - HInt off, Enable HV counter read
	dc.b	$14		; Command $8114 - Display off, VInt off, DMA on, PAL off
	dc.b	$30		; Command $8230 - Scroll A Address $C000
	dc.b	$3C		; Command $833C - Window Address $F000
	dc.b	$07		; Command $8407 - Scroll B Address $E000
	dc.b	$6C		; Command $856C - Sprite Table Address $D800
	dc.b	$00		; Command $8600 - Null
	dc.b	$00		; Command $8700 - Background color Pal 0 Color 0
	dc.b	$00		; Command $8800 - Null
	dc.b	$00		; Command $8900 - Null
	dc.b	$FF		; Command $8AFF - Hint timing $FF scanlines
	dc.b	$00		; Command $8B00 - Ext Int off, VScroll full, HScroll full
	dc.b	$81		; Command $8C81 - 40 cell mode, shadow/highlight off, no interlace
	dc.b	$37		; Command $8D37 - H Scroll Table Address $DC00
	dc.b	$00		; Command $8E00 - Null
	dc.b	$01		; Command $8F01 - VDP auto increment 1 byte
	dc.b	$01		; Command $9001 - 64x32 cell scroll size
	dc.b	$00		; Command $9100 - Window H left side, Base Point 0
	dc.b	$00		; Command $9200 - Window V upside, Base Point 0
	dc.b	$FF		; Command $93FF - DMA Length Counter $FFFF
	dc.b	$FF		; Command $94FF - DMA Length Counter $FFFF
	dc.b	$00		; Command $9500 - DMA Source Address $0
	dc.b	$00		; Command $9600 - DMA Source Address $0
	dc.b	$80		; Command $9780 - DMA Source Address $0 + VRAM fill mode
VDPInitValuesEnd:

	dc.l	$40000080

Z80StartupCode:
	save
	cpu Z80

	xor	a
	ld 	bc, 1FD9h
	ld 	de, 27h
	ld 	hl, 26h
	ld	sp, hl
	ld	(hl), a
	ldir
	pop ix
	pop iy
	ld	i, a
	ld	r, a
	pop	de
	pop	hl
	pop	af
	ex	af, af'
	exx
	pop bc
	pop	de
	pop	hl
	pop	af
	ld	sp, hl
	di
	im	1
	ld	(hl), 0E9h
	jp	(hl)

	restore
	padding off
Z80StartupCode_End:

	dc.w	$8104
	dc.w	$8F02
	dc.l	$C0000000
	dc.l	$40000010

PSGInitValues:
	dc.b	$9F, $BF, $DF, $FF	; values for PSG channel volumes
PSGInitValues_End:
; ====================================

	else
	
	if revision=0
	lea	(ROMEndLoc).l, a0
	else
	lea	(ROMEndLoc).w, a0
	endif
	move.l	(a0), d0
	addq.l	#1, d0
	if revision=0
	lea	(EndOfHeader).l, a0
	else
	lea	(EndOfHeader).w, a0
	endif
	sub.l	a0, d0
	asr.l	#1, d0
	move.w	d0, d2
	subq.w	#1, d2
	swap	d0
	moveq	#0, d1
-
	add.w	(a0)+, d1
	dbf	d2, -
	dbf	d0, -

	if revision=0
	cmp.w	(Checksum).l, d1
	else
	cmp.w	(Checksum).w, d1
	endif
	beq.s	ChecksumOK
	move.l	d1, -(sp)
	jsr	(MainGameVDPSetup).l
	move.l	#$C0000000, vdp_control_port
	moveq	#$3F, d7
-
	move.w	#$E, vdp_data_port
	dbf	d7, -
	move.l	(sp)+, d1

ChecksumErrorLoop:
	bra.s	ChecksumErrorLoop

	endif

ChecksumOK:
	if revision=2
	tst.w	vdp_control_port
	nop
	nop
	endif
	move.b	hw_version, d0
	andi.b	#$F, d0
	beq.s	GameInit
	move.l	#'SEGA', security_addr
GameInit:
	move	#$2700, sr
	lea	(ram_start).l, a0
	moveq	#0, d0
	move.w	#$3FFF, d2
-
	move.l	d0, (a0)+
	dbf	d2, -

	bra.s	GameProgram

