GameProgram:
	bsr.w	MainGameVDPSetup
	bsr.w	VDPDisableDisplay
	jsr	(SetupSoundDriver).l
	bsr.w	ClearCRAM
	bsr.w	InitJoypads
	bsr.w	VDPClearAll
	clr.b	(event_flags).w
	bsr.w	VDPEnableDisplay
	bsr.w	VDPEnableVInterrupt

; -----------------------------------------------
MainGameLoop:
	bsr.w	WaitVBlankAndGamePause
	bsr.w	ProcessGameEvents
	bsr.w	ProcessGameScreens
	bsr.w	RunPrimaryObjs
	bsr.w	RunSecondaryObjs
	bsr.w	BuildSprites

	bra.s	MainGameLoop
; -----------------------------------------------

VBlank:
	movem.l	d0-a7, -(sp)
	bset	#7, (global_status_flags).w
	btst	#6, (global_status_flags_3).w	; are we moving data into VRAM?
	bne.s	VBlank_End		; if so, return
	btst	#3, (global_status_flags_3).w	; has the Z80 stopped?
	bne.s	VBlank_End		; if so, return

	bsr.w	ReadJoypads

	bsr.w	loc_729E
	bsr.w	loc_6EA0
	bsr.w	loc_71A6

	move.w	#$A0, d2
-
	nop
	dbf	d2, -

	btst	#6, (global_status_flags_2).w
	beq.s	VBlank_End
	bclr	#6, (global_status_flags_2).w
	bsr.w	UpdateCRAM
VBlank_End:
	movem.l	(sp)+, d0-a7


HBlank:
	rte

