	if revision<>2
VDPInitValuesEnd:
	endif

	if revision<>2
Z80StartupCode:
	endif
	save
	cpu Z80

	xor	a
	ld 	bc, 1FD7h
	ld 	de, 29h
	ld 	hl, 28h
	ld	sp, hl
