ProcessGameEvents:
	tst.b	(event_flags).w	; are we at the first iteration of the program?
	bpl.s	InitGameEvents	; if so, branch and initialize--the code that runs below will set the flag so it won't run again
	lea	(obj_game_event).w, a5
	movea.l	$4(a5), a0		; get game event pointer
	jmp	(a0)				; and run event

; only runs once, that is when the game program starts
InitGameEvents:
; since this occurs only at the start of the game program, it will only fetch the first entry of the table, that is Rhys generation
	lea	(GenStartingEventPtrs).l, a0
	move.w	(generation_index).w, d0
	add.w	d0, d0
	add.w	d0, d0
	move.l	(a0,d0.w), (game_event_pointer).w
	lea	(obj_game_event+$10).w, a0
	moveq	#0, d0	; clear whatever data we find
	moveq	#2, d1
-
	move.l	d0, (a0)+
	move.l	d0, (a0)+
	move.l	d0, (a0)+
	move.l	d0, (a0)+
	dbf	d1, -
	lea	(event_flags).w, a0
	moveq	#0, d0		; clear all flags
	moveq	#$F, d1
-
	move.l	d0, (a0)+
	move.l	d0, (a0)+
	move.l	d0, (a0)+
	move.l	d0, (a0)+
	dbf	d1, -

	st	(event_flags).w	; set byte at this offset so we don't run this part anymore (also, to make other data handling convenient)
	rts

; Very first event
Event_RhysStart:
	st	(event_flags).w		; This flag is already supposed to be set, but set it again just in case
	move.l	#$00FFFFFF, (event_flags+EventFlag_RhysGeneration).w	; special flags for the other generations: when the bytes at the specified offsets are set, we are NOT in the respective generation
											; For example when Ayn quest starts, the byte at offset $19 is cleared
	move.l	#$FFFFFFFF, (event_flags+EventFlag_CrysGeneration).w
	move.l	#Event_RhysMaiaWedding, $4(a5)
	rts

Event_RhysMaiaWedding:
	lea	(map_controls).w, a0	; load base object for the character sprites
	move.w	$8(a0), d0				; get x position
	move.w	$A(a0), d1				; get y position
	move.w	(scene_id).w, d2			; get scene ID
	subi.w	#$150, d0				; subtract 336 to our x position
	subi.w	#$1C0, d1				; subtract 448 to our y position
	subi.w	#SceneID_LandenCastle, d2	; $3C is the scene ID indicating the castle in Landen
	or.w	d0, d1					; check if we're at the exact position (i.e. x = 336, y = 448)
	or.w	d1, d2					; then check the scene we are in
	bne.s	+						; if above conditions are not met, return
	jsr	(FindFreeSlotInSecObjTable).l	; otherwise run the cutscene for the wedding
	clr.l	(a6)
	move.w	#$C000, (a6)				; fill data at this memory location
	move.l	#Obj_RhysMaiaWeddingCutscene, $4(a6)			; load pointer
	bset	#2, (global_status_flags).w	; enable cutscene
	clr.w	(cutscene_joypad_input).w
	move.l	#Event_RhysMaiaWeddingMusic, $4(a5)
+
	rts

Event_RhysMaiaWeddingMusic:
	move.w	#MusicID_Wedding, d0
	jsr	(UpdateSoundQueue).l
	move.l	#Event_RhysToLandenDungeon, $4(a5)
	rts

Event_RhysToLandenDungeon:
	cmpi.w	#SceneID_LandenDungeon, (scene_id).w
	bne.s	+			; return if we're not in the Landen dungeon
	move.l	#Event_RhysInLandenDungeon, $4(a5)
	move.b	#$1C, $10(a5)
	clr.w	(cutscene_joypad_input).w
+
	rts

Event_RhysInLandenDungeon:
	subq.b	#1, $10(a5)
	bne.s	+			; wait for a while
	jsr	(FindFreeSlotInSecObjTable).l
	clr.l	(a6)	; empty initial data
	move.w	#$C000, (a6)	; move new data
	move.l	#loc_11C16, $4(a6)
	bset	#2, (global_status_flags).w	; cutscene
	
; Fix: make sure you can't use the Escapipe while Rhys is in the dungeon.
	if bugfixes=1
	bclr	#4, (global_status_flags_4).w
	endif
	
	clr.w	(cutscene_joypad_input).w
	jsr	(FindFreeSlotInSecObjTable).l
	clr.l	(a6)
	move.w	#$C000, (a6)
	move.l	#loc_11E62, $4(a6)
	move.l	#Event_RhysInPrison, $4(a5)
+
	rts

Event_RhysInPrison:
	tst.b	(treasure_chest_flags+0).w	; was the treasure chest with the Knife opened?
	beq.s	+			; if not, return
	tst.b	(treasure_chest_flags+1).w	; was the treasure chest with the Monitor opened?
	beq.s	+			; if not, return
	jsr	(FindFreeSlotInSecObjTable).l	; find free spot in memory
	clr.l	(a6)
	move.w	#$C000, (a6)	; take up slot
	move.l	#Obj_LandenDungnLena, $4(a6)	; load Lena sprite
	move.l	#Event_RhysEscapeSequence, $4(a5)
+
	rts

Event_RhysEscapeSequence:
	tst.b	(event_flags+EventFlag_LandenPrisonDoor).w		; is the prison door in the Landen dungeon open?
	beq.s	+						; if not, return
	jsr	(FindFreeSlotInSecObjTable).l
	clr.l	(a6)
	move.w	#$C000, (a6)
	move.l	#loc_11C2E, $4(a6)
	bset	#2, (global_status_flags).w	; cutscene
	clr.w	(cutscene_joypad_input).w
	move.l	#Event_RhysWaitTechStore, $4(a5)
+
	rts

Event_RhysWaitTechStore:
	cmpi.w	#SceneID_LandenTechStore, (scene_id).w	; are we in the Landen technique distribution store?
	bne.s	+				; if not, wait
	move.l	#Event_RhysInsideTechStore, $4(a5)
	move.b	#$1C, $10(a5)
	clr.w	(cutscene_joypad_input).w
+
	rts

Event_RhysInsideTechStore:
	subq.b	#1, $10(a5)
	bne.s	+			; wait for a while
	jsr	(FindFreeSlotInSecObjTable).l
	clr.l	(a6)
	move.w	#$C000, (a6)
	move.l	#loc_11C46, $4(a6)
	bset	#2, (global_status_flags).w	; cutscene
	clr.w	(cutscene_joypad_input).w
	move.l	#Event_RhysChkOutsideTechStore, $4(a5)
+
	rts

Event_RhysChkOutsideTechStore:
	cmpi.w	#SceneID_LandenTechStore, (scene_id).w	; are we still in the Landen technique store?
	beq.s	+					; if so, return
	st	(event_flags+EventFlag_PrisonBreakout).w		; otherwise update event flags
	clr.w	(cutscene_joypad_input).w
	bclr	#7, (script_flags).w	; disable auto scrolling
	bclr	#2, (global_status_flags).w	; disable cutscene
	move.l	#Event_RhysChkShusoran, $4(a5)
+
	rts

Event_RhysChkShusoran:
	cmpi.w	#SceneID_ShusoranCastle, (scene_id).w	; are we in the castle of Shusoran?
	bne.s	+					; if not, return
	move.l	#Event_RhysShusoranCastle, $4(a5)
+
	rts

Event_RhysShusoranCastle:
	btst	#5, (global_status_flags_4).w	; are we loading a map?
	bne.s	+								; if so, branch
	jsr	(FindFreeSlotInSecObjTable).l
	clr.l	(a6)
	move.w	#$C000, (a6)
	move.l	#Obj_ShusoranLena, $4(a6)
	move.l	#Event_RhysChkSpotShusoran, $4(a5)
+
	rts

; Run until Rhys and Lyle dialogue about there being Lena takes place
Event_RhysChkSpotShusoran:
