	beq.s	+							;  if so, branch
	move.l	#Event_RhysChkShusoran, $4(a5)	; repeat this part because we need to load the objects and other stuff when we enter again
	rts
+
	cmpi.w	#$1F0, (map_controls+8).w		; are we at x = 496?
	beq.s	+						; if we are, check y position
	rts
+
	cmpi.w	#$208, (map_controls+$A).w		; are we at y = 520?
	beq.s	+								; if so, branch
	rts

; Process Rhys and Lyle dialogue about Lena
+
	bclr	#4, (global_status_flags_4).w	; cannot use Escapipe
	clr.b	($FFFFD122).w
	move.b	#3, ($FFFFD123).w
	move.w	#loc_26C44-GameScript, (script_offset).w
