	rts

WaitVBlankAndGamePause:
	btst	#7, (global_status_flags).w
	beq.s	WaitVBlankAndGamePause		; wait until V blanking is over
	bclr	#7, (global_status_flags).w	; clear bit so that it will wait for the V blanking again
	move.b	(global_status_flags).w, d2
	btst	#6, d2
	beq.s	BranchTo_UpdateRNGSeed
	btst	#5, (global_status_flags_4).w	; are we loading a map?
	bne.s	BranchTo_UpdateRNGSeed			; if so, branch
	move.b	(joypad_pressed_1).w, d1
	btst	#ButtonStart, d1	; did we press the start button?
	beq.s	loc_6D84			; if not, branch
	moveq	#1, d0		; stop music
	bchg	#4, d2		; toggle paused bit
	beq.s	loc_6D7A	; branch if game was not paused
	move.b	#$80, d0	; if we pressed the start button when game was paused, resume music
