Character_CalcAttackDamage:
	bsr.w	UpdateRNGSeed
	movea.w	$6C(a6), a0	; a0 = character's stats 
	movea.w	$72(a6), a1	; a1 = enemy's stats
	movea.l	$6E(a6), a2	; a2 = item address
	moveq	#0, d1
	move.b	$8(a2), d1	; d1 = attack power
	add.w	attack_mod(a0), d1	; add Fanbi power
	btst	#4, $F(a2)
	beq.s	.normaldamage	; branch if it's normal damage
							; otherwise it's fixed damage (e.g. guns)
	andi.w	#$1F, d0	; RNG = 0-31
	move.w	d1, d2		; copy item attack power
	mulu.w	d0, d1		; multiply by RNG
	lsr.l	#8, d1		; divide by 256
	add.w	d1, d2		; add random value to attack power
	move.w	d2, $74(a6)	; and store it
	rts

.normaldamage:
	andi.w	#$3F, d0	; RNG = 0-63
	move.w	attack(a0), d2	; d2 = attack
	move.w	weapon_attack(a0), d3	; d3 = weapon power
	sub.w	d3, d2		; get base power
	addi.w	#30, d2		; add 30
	mulu.w	d1, d2		; multiply by item attack power
	movea.l	$3C(a1), a3	; a3 = enemy data
	move.w	$12(a3), d1	; get enemy's defense
	addi.w	#30, d1	; add 30
	divu.w	d1, d2	; total attack / total defense
	move.w	d2, d1
	mulu.w	d0, d1	; multiply total by random number
	lsr.l	#8, d1	; divide by 256
	add.w	d1, d2	; add random value to total
	move.w	d2, $74(a6)	; and store it
	rts

Enemy_CalcAttackDamage:
	bsr.w	UpdateRNGSeed
	andi.w	#$3F, d0	; RNG = 0-63
	movea.w	$6C(a6), a0	; a0 = enemy's stats
	movea.w	$72(a6), a1	; a1 = character's stats
	movea.l	$6E(a6), a2	; a2 = character's weapon address
	movea.l	$3C(a0), a3	; a3 = enemy data address
