	cmpi.b	#$FC, d1	; are the high 6 bits set?
	bcc.s	Nem_InlineData	; if so, it means inline data
	andi.w	#$FF, d1
	add.w	d1, d1
	move.b	(a1,d1.w), d0		; get the length of the code in bits
	ext.w	d0
	sub.w	d0, d6				; subtract from shift value so that the next code is read next time around
	cmpi.w	#9, d6				; does a new byte need to be read?
	bcc.s	+			; if not, branch
	addq.w	#8, d6
	asl.w	#8, d5
	move.b	(a0)+, d5	; read next byte
+
	move.b	$1(a1,d1.w), d1
	move.w	d1, d0
	andi.w	#$F, d1		; get palette index for pixel
	andi.w	#$F0, d0

Nem_GetRepeatCount:
	lsr.w	#4, d0		; get repeat count

Nem_WritePixel:
	lsl.l	#4, d4		; shift up by a nybble
	or.b	d1, d4		; write pixel
	subq.w	#1, d3		; has an entire 8-pixel row been written?
	bne.s	Nem_WritePixel_Loop	; if not, loop
	jmp	(a3)			; otherwise, write the row to its destination

NemDec_WriteIter:
	moveq	#0, d4		; reset row
	moveq	#8, d3		; reset nybble counter
Nem_WritePixel_Loop:
	dbf	d0, Nem_WritePixel
	bra.s	Nem_ProcessCompressedData


Nem_InlineData:
	subq.w	#6, d6		; 6 bits needed to signal inline data
	cmpi.w	#9, d6
	bcc.s	+
	addq.w	#8, d6
	asl.w	#8, d5
	move.b	(a0)+, d5
+
	subq.w	#7, d6		; and 7 bits needed for the inline data itself
	move.w	d5, d1
	lsr.w	d6, d1		; shift so that low bit of the code is in bit position 0
	move.w	d1, d0
	andi.w	#$F, d1		; get palette index for pixel
	andi.w	#$70, d0	; high nybble is repeat count for pixel
	cmpi.w	#9, d6
	bcc.s	Nem_GetRepeatCount
	addq.w	#8, d6
	asl.w	#8, d5
	move.b	(a0)+, d5
	bra.s	Nem_GetRepeatCount

