Nem_WriteRowToRAM:
	move.l	d4, (a4)+
	subq.w	#1, a5
	move.w	a5, d4
	bne.s	NemDec_WriteIter
	rts

Nem_WriteRowToRAM_XOR:
	eor.l	d4, d2
	move.l	d2, (a4)+
	subq.w	#1, a5
	move.w	a5, d4
	bne.s	NemDec_WriteIter
	rts

Nem_BuildCodeTable:
	move.b	(a0)+, d0	; read first byte
loc_DA44:
	cmpi.b	#$FF, d0	; has the end of the code table description reached?
	bne.s	Nem_NewPalIndex	; if not, continue
	rts

Nem_NewPalIndex:
	move.w	d0, d7

loc_DA4E:
	move.b	(a0)+, d0	; read next byte
	bmi.s	loc_DA44	; if sign bit is set, process new palette index
	move.b	d0, d1
	andi.w	#$F, d7		; get palette index
	andi.w	#$70, d1	; get repeat count for palette index
	or.w	d1, d7		; merge palette index with repeat count
	andi.w	#$F, d0		; get the length of the code in bits
	move.b	d0, d1
	lsl.w	#8, d1
	or.w	d1, d7
	moveq	#8, d1
	sub.w	d0, d1		; is the code 8 bits long?
	bne.s	loc_DA78	; if not, do more processing
	move.b	(a0)+, d0	; get code
	add.w	d0, d0		; each code gets a word-sized entry in the table
	move.w	d7, (a1,d0.w)	; store the entry for the code
	bra.s	loc_DA4E		; repeat

loc_DA78:
	move.b	(a0)+, d0	; get code
	lsl.w	d1, d0		; shift so that high bit is in bit position 7
	add.w	d0, d0		; get index into code table
	moveq	#1, d5
	lsl.w	d1, d5
	subq.w	#1, d5
-
	move.w	d7, (a1,d0.w)	; store entry
	addq.w	#2, d0			; increment index
	dbf	d5, -
	bra.s	loc_DA4E
; ==========================================================
	endif

