Battle_SetAttackPriority:
	btst	#0, ($FFFFD00A).w
	bne.s	Battle_SetupRegular
	btst	#1, ($FFFFD008).w
	bne.s	Battle_SetupRegular
	bclr	#7, ($FFFFD009).w
	bsr.w	UpdateRNGSeed	; get random number and store it into d0
	andi.b	#7, d0				; 0-7 (8 values)
	subq.b	#1, d0				; subtract 1
	bmi.s	Battle_SetupPreempStrike		; if number is negative, you surprised the monster
	beq.s	Battle_SetupAmbush			; if 0, you've been ambushed

