	beq.s	loc_E8F6		; if so, branch -- failed to escape
	bclr	#7, ($FFFFD009).w	; clear surprised enemy bit
	bne.s	Battle_Exit		; if it was set, branch -- we surprised the enemy, meaning we can always escape at the first turn
