chest_item = $30
chest_saved_id = $32
; -----------------------------------------------------------------
; Load new treasure chest after a particular event
Obj_EventTreasureChest:
	lea	(treasure_chest_flags).w, a0	; load the flags
	moveq	#0, d0
	move.b	subtype(a5), d0	; get ID
	tst.b	(a0,d0.w)	; did we get past the event
	bne.s	+	; is so, branch
	clr.w	(a5)		; otherwise delete object
	rts

+
	addq.b	#1, subtype(a5)	; get ID for the actual chest
	move.l	#Obj_TreasureChest, update_addr(a5)	; and save pointer
; -----------------------------------------------------------------


; -----------------------------------------------------------------
Obj_TreasureChest:
	move.w	routine(a5), d0
	jmp	TreasureChestRoutines(pc,d0.w)
; -----------------------------------------------------------------


; =================================================================
TreasureChestRoutines:
	bra.w	TreasureChest_Init
	bra.w	TreasureChest_Main
	bra.w	TreasureChest_Done
; =================================================================


; -----------------------------------------------------------------
TreasureChest_Init:
	moveq	#0, d0
	move.w	#4, sprite_type(a5)
	move.w	d0, frame_counter(a5)
	move.w	d0, mapping_frame(a5)
	move.w	#$4000, art_tile(a5)
	move.w	#loc_286B4-GameScript, script_offs(a5)
	move.b	subtype(a5), d0	; get chest ID
	cmpi.b	#$58, d0	; is it the Miun Claw?
	beq.s	+	; if so, branch
	move.l	#loc_21404, mappings(a5)
	bra.s	++

+
	move.l	#loc_21410, mappings(a5)
+
	clr.b	subtype(a5)
	move.b	d0, chest_saved_id(a5)	; save chest ID
	add.w	d0, d0
	move.w	d0, d1
	add.w	d0, d0
	add.w	d1, d0		; multiply by 6
	lea	(TreasureChestData).l, a0
	adda.w	d0, a0		; get chest data indicated by ID
	move.w	(a0)+, x_pos(a5)	; store x position
	move.w	(a0)+, y_pos(a5)	; store y position
	move.w	(a0), chest_item(a5); store item
	move.w	#4, routine(a5)		; => TreasureChest_Main 
	lea	(treasure_chest_flags).w, a0
	moveq	#0, d0
	move.b	chest_saved_id(a5), d0	; get chest ID
	tst.b	(a0,d0.w)	; test if byte indicated by offset is set
	beq.s	+	; if it's not, display object and move to main routine
	move.w	#2, mapping_frame(a5)
	addq.w	#4, routine(a5)	; => TreasureChest_Done
+
	jsr	(Obj_SpritePosOnScreenTest).l
	jsr	(Obj_SetCollisionData).l
	jmp	(Obj_LoadSprite).l
; -----------------------------------------------------------------


; -----------------------------------------------------------------
TreasureChest_Main:
	if revision=0
	_btst	#5, 0(a5)
	else
	btst	#5, (a5)
	endif
	beq.s	+
	jmp	(Obj_SpritePosOnScreenTest).l
+
	btst	#5, (global_status_flags_3).w	; was the A button pressed?
	beq.s	TreasureChest_Done				; if not, branch
	moveq	#0, d1
	moveq	#0, d2
	jsr	(loc_6AF2).l
	beq.s	TreasureChest_Done
	bsr.w	TreasureChest_AddToInventory
	bcs.s	TreasureChest_Done
	moveq	#0, d0
	move.b	$32(a5), d0
	lea	(treasure_chest_flags).w, a0
	st	(a0,d0.w)
	addq.w	#2, $22(a5)
	addq.w	#4, $2(a5)
	move.w	#$B7, d2
	jsr	(loc_14836).l
; -----------------------------------------------------------------


; -----------------------------------------------------------------
TreasureChest_Done:
	jsr	(Obj_SpritePosOnScreenTest).l
	jsr	(Obj_SetCollisionData).l
	jmp	(Obj_LoadSprite).l
; -----------------------------------------------------------------


