Obj_SunkenPalace:
	move.w	$2(a5), d0
	jmp	ObjSunkenPalace_Routines(pc,d0.w)

ObjSunkenPalace_Routines:
	bra.w	ObjSunkenPalace_Init
	bra.w	ObjSunkenPalace_Main
	bra.w	ObjSunkenPalace_Touched

ObjSunkenPalace_Init:
	tst.b	(treasure_chest_flags+$2C).w	; did we open the chest with the Laya Pendant?
	bne.s	+						; if so, branch
	clr.w	(a5)
	rts

+
	addq.w	#4, $2(a5)
ObjSunkenPalace_Main:
	btst	#4, ($FFFFC001).w
	beq.w	loc_1AA26
	move.w	($FFFFD13C).w, d0		; get Wren's x position
	move.w	($FFFFD13E).w, d1		; get Wren's y position
	move.w	d0, d2				; d0 = x1; d2 = x2
	move.w	d1, d3				; d1 = y1; d3 = y2
	subi.w	#$6F0, d0			; range from $6F0 to $739
	subi.w	#$739, d2
	subi.w	#$3B8, d1			; range from $3B8 to $401
	subi.w	#$401, d3
	eor.w	d0, d2				; check sign bit for x1-x2
	eor.w	d1, d3				; check sign bit for y1-y2
	and.w	d2, d3				; are both sign bits set?
	bpl.s	loc_1AA26			; if not, return
	bset	#1, (global_status_flags_4).w	; Wren transform
	move.w	#2, (wren_transform_index).w	; transform into the Submersible
	addq.w	#4, $2(a5)	; ObjSunkenPalace_Touched
loc_1AA26:
	rts

ObjSunkenPalace_Touched:
	btst	#1, (global_status_flags_4).w	; Is Wren transforming?
	bne.s	loc_1AA54						; if so, branch
	bset	#4, (global_status_flags_2).w	; scene reload
	move.w	#$40, (scene_id_saved).w
	move.w	#$270, (scene_x_pos).w
	move.w	#$340, (scene_y_pos).w
	move.b	#$C, (screen_x_pos).w
	move.b	#$10, (screen_y_pos).w
loc_1AA54:
	rts

; This just checks the x and y coordinates
Obj_SunkenPalaceExit:
	btst	#3, ($FFFFC001).w
	beq.w	loc_1AACE
	move.w	($FFFFD13C).w, d0	; get Wren's x position
	move.w	($FFFFD13E).w, d1	; get Wren's y position
	move.w	d0, d2
	move.w	d1, d3
	subi.w	#$248, d0	; right x radius
	subi.w	#$360, d1	; low y radius
	subi.w	#$299, d2	; left x radius
	subi.w	#$371, d3	; high y radius
	eor.w	d0, d2		; sign bit of x
	eor.w	d1, d3		; sign bit of y
	and.w	d2, d3		; get sign bit of both x and y
	bpl.s	loc_1AACE	; if at least one is positive, return
	; otherwise return to World Map
	bset	#4, (global_status_flags_2).w	; scene reload
	move.w	#SceneID_LandenWorld, (scene_id_saved).w	; Landen World Map
	move.w	#$710, (scene_x_pos).w		; x position
	move.w	#$410, (scene_y_pos).w		; y position
	move.b	#$2F, (screen_x_pos).w
	move.b	#$17, (screen_y_pos).w
	bset	#1, (global_status_flags_4).w	; Wren transform
	move.w	#0, (wren_transform_index).w	; Aquaskimmer
	move.w	#$710, ($FFFFC008).w
	move.w	#$410, ($FFFFC00A).w
	move.w	#$710, ($FFFFD13C).w
	move.w	#$410, ($FFFFD13E).w
	clr.w	(a5)
loc_1AACE:
	rts

