; ======================================================================
; Characters' initial data
;
; Byte 1: Character ID
; Byte 2: HP
; Byte 3: TP
; Byte 4: Attack
; Byte 5: Defense
; Byte 6: Speed
; Byte 7: ?
; Bytes 8-12: Character's name; end name delimiter is $FC; remaining bytes, if any, are padded with $00's
; Byte 13: Luck
; Byte 14: Skill
; Bytes 15-16: Offset to EXP table
; Bytes 17-18: Offset to Technique growth rate
; Bytes 19-20: Number of items
; Bytes 21-?: variable list of items which depends on number above
; 		$8000 = Head
; 		$8002 = Right Hand
; 		$8004 = Left Hand
; 		$8006 = Torso
; 		$8008 = Feet
; 		$800A = Buckle
; 		$800C = Both Hands
;
; After the initial items are the bytes for the technique grid
;
; For the technique grids, each one corresponds with four bytes for each half (left and right respectively, eight bytes in total).
; If the technique isn't a starting tech, the field is left blank with a "0".
;
;	0150	The first two bytes of a grid correspond to the upper left corner. The first value is the width, the second is for the height.
;	2  6	The third and fourth bytes determine the width and then height of the lower left corner.
;	4  8	The fifth and six are for the upper right corner.the seventh and eighth are for the lower right.
; 	0370	(Forgive the poor ASCII art, 0 is placeholders for the corners)
;
; The sets are listed as follows:
; 	Melee(left side 1-4), Melee(right side 5-8), Heal(left), Heal(right), Time(left), Time(right), Order(left), Order(right)
;
; Mieu's techniques, as an example:
;	dc.l	0, 0, $02020202, $02020202, 0, 0, $02020202, $02020202
;
; She will start with Heal and Order techs of a 4x4 grid; each value gives a width and height of 2, totaling as "3" for tech power.
;
; Initialized grid size values: (increases in odd-numbered increments)
;	01 = 1
;	02 = 3 (lowest starting value set in game) Mieu, Wren, Thea, Kara(both)
;	03 = 5 Crys
;	04 = 7 Lyle, Laya, Gwyn
;	05 = 9 Ayn, Ryan
;	06 = 11 (highest starting value set in game) Sean, Aron, Adan
;	07 = 13
;	08 = 15
;	09 = 17
;	0A = 19	;etc.
;
; Note: It is not recommended to set high numbers, the grid's display runs off the screen in the tech rebalance shop.
; If you mix and match numbers, you will have uneven sized grids rather than the standard (like 4x4).
; ======================================================================

