; ------------------------------------------------------
; Stat increase pointers and EXP values
;
; Stat increase
;
; 1 = HP
; 2 = TP
; 3 = Damage
; 4 = Defense
; 5 = Speed
; 6 = Luck
; 7 = Skill
;
; You can easily extend EXP tables and make characters reach lv 99 if you wish.
; Keep in mind that the values for EXP are the total EXP the a character needs to learn
; and not the EXP needed to go up a level. So for a certain level, make sure you don't have values equal or less than
; the previous levels or there will most likely be bugs.
; ------------------------------------------------------

