; ==============================================

; ==============================================
; The first word for each scene is the number of NPCs on a scene (count - 1);
; if it's $FFFF, there are no NPCs. After that are the bytes for NPC data
;
; Byte 1 = index of the NPCObjectPtrs table
; Byte 2 = index of the NPCSpriteMappingsPtrs table;
; Bytes 3-4 = X position
; Bytes 5-6 = Y position
; Bytes 7-8 = can have different meanings:
;	- Script offset
;	- Shop-related data if byte 1 references an object for shop NPCs (e.g. $08 = Obj_Shopkeeper).
;		Byte 7 determines the type of shop.
;			- 0 (items/supply)
;			- 1 (weapon)
;			- 2 (armor)
;			- 3 (clinic/nurse)
;			- 4 (church)
;			- 5 (technique distribution)
;			- 6 (fortune)
;			- 7 (inn)
;		Byte 8 refers to the ShopsInventoryData index; if byte 7 is 3 or higher, byte 8's index value is ignored
; Bytes 9-10 = NPC X/Y position update rate
; ==============================================

