; =====================================================

; ======================================================================
; Scene transition data
;
;   Access points and data when you change scenes
;
; First word is the number of map transition chunks. Each chunk is made
; up of 16 bytes
;
; Bytes 1-2: X coordinates on current scene
; Bytes 3-4: Y coordinates on current scene
; Bytes 5-6: Scene to move to
; Bytes 7-8: X coordinates on scene moved to
; Bytes 9-10: Y coordinates on scene moved to
; Bytes 11-12: pixel size of transition point (32x32)
; Bytes 13-14: screen X and Y coordinates, shifts in tile-sized increments
; Byte 15: Type of access
;		0 = normal access
;		1 = blocked cave, gemstone required for access
;		2 = normal access and makes it possible to use the Escapipe
;		3 = submersible access (used for Laya's world, Sub Parts required)
; Byte 16: index of gem required for entry
;		0 = Sapphire
;		1 = No entry
;		2 = TwinsRuby
;		3 = DragnTear
;		4 = MstryStar
; ======================================================================

