; ===============================================================
; Inventory Data
;
; Bytes 1-2 = Unused
; Bytes 3-4 = Pointer to the item's name
; Bytes 5-6 = Cost
; Byte 7 = Animation index (this only matters if the item is equipable for one or both hands)
;		00 = Sword
;		04 = Knife
;		08 = Staff
;		0C = Slicer
;		10 = Claw
;		14 = Bow
;		18 = Shot
;		1C = Needle
; Byte 8 = Target selection (this only matters if the item is equipable for one or both hands)
;		00 = No attack, character defends
;		08 = Single target, close range
;		0A = Single target, long range
;		0C = Front or back row
;		0E = Left or right groups
;		10 = All
; Byte 9 = Attack increase
; Byte 10 = Defense increase
; Byte 11 = Speed increase
; Byte 12 = Technique ID; when the MSB is set, it determines actions to perform in the menu
; Byte 13 = Technique effectiveness
; Byte 14 = Bitfield - Characters that can equip the item
; Byte 15 = Equip where
;		00 = Not equipable
;		04 = Head
;		08 = Single hand
;		OC = Both hands
;		10 = Body
;		14 = Feet
;		18 = Buckle
; Byte 16 = Actions for item ; bitfield
;		bit 0-3: Seemingly unused
;		bit 4: 1 = Shot attribute, ignores enemy defense and damage value remains static with the weapon's power; 0 = Normal damage
;		bit 5: 1 = ??? (Note: Only Knife and ShortSwd are set with this value); 0 = ???
;		bit 6: Discard flag; 1 = Disposable, 0 = Can't throw away
;		bit 7: Consumable flag; 1 = Item is depleted after use, 0 = Reusable item
; ===============================================================
