; =================================================================
; Window data related to shop/system messages on that screen
;	word 1 - x position
;	word 2 - y position
;	word 3 - width
;	word 4 - height (use even numbers)
;	word 5 - ???
;	word 6 - ???
; -------------------
; Notes:
; - the numbers are finicky and if the values are extreme, it breaks boxes and how text strings are read
; - x/y values actually cut off the window display if altered alone
; - suspected width value (3rd listed) broke the game ... probable that it wasn't centered enough to accommodate expansion
; =================================================================
; =================================================================
Win_ShopSystemMsg:	;message box (shop/system only)
	dc.w	$0004, $0014, $0034, $0006, $0018, $0002
; =================================================================

